Then one item at a time chop the nuts course and roast till golden in a tsp of coconut oil. I blanch my almonds first to remove anti nutrients.

Then roast sesame seeds in a dry pan, followed by grated coconut until pink and toasted. 

Mix all the ingredients together in a large bowl including flax seeds and dried berries and a pinch or more of ground cinnamon. 

Shake it up and enjoy with warm milk not cold. Packed with nutrients and EFA‚Äôs 

If you like it sweeter then add honey or maple syrup while eating but the berries are sweet enough for me and mine. 

